import '../css/main.css';
import { StyleSheet, View, } from 'react-native';

//Import images
import instagram from '../assets/img/instagram.png';
import facebook from '../assets/img/facebook.png';

// Import theme
import { ThemeProvider, } from 'react-native-elements';
import { HwangsTheme } from '../themes/HwangsTheme';

export default function Footer() {
    return(
        <ThemeProvider theme={HwangsTheme}>
            <View style={styles.foote}>
                <View style={styles.socials} >
                    <a href="https://www.instagram.com/hwang_skitchen/?hl=en">
                        <img src={instagram} alt="instagram icon" className='socialIcon' />
                    </a>
                    <a href="https://m.facebook.com/HwangsKitchen/">
                        <img src={facebook} alt="facebook icon" className='socialIcon' />
                    </a>
                </View>
                <View style={{alignItems:'center', flex:1}}>
                    <a href="mailto:hwangskitchencoq@gmail.com" className='contactInfo'>hwangskitchencoq@gmail.com</a>
                    <a href="tel:6044695559" className='contactInfo'>(604) 469 - 5559</a>
                </View>
            </View>
        </ThemeProvider>
    );
}

const styles = StyleSheet.create({
    container: {
      paddingTop: 40,
      paddingLeft: 10,
      paddingRight: 10,
      paddingBottom:15
    },
    footer: {
      alignItems: "center",
      flex:1,
      backgroundColor:'#545454'
    },
    socials: {
        flexDirection: 'row',
    }
  });
